  const addTodo = (todo) => { 
    setTodos([todo , ...todos])
  }
  return ( 
    <div className='Container' >
      <TodoForm onSubmit={addTodo}/>
      {
        todos.map((todo) =>(
          <Todo 
          key ={todo.id}
          todo={todo}
          onDelete ={() => handlDelete(todo.id)}
          />
        ))
      }
    </div>
  )
}

export default App
